import "../../styling/testimonials/compellingreview.css";

function CompellingReview() {
  return (
    <div id="compellingreview">
      <h1 id="compellingreview-text">
        “[her] writing skills have improved considerably”
      </h1>
    </div>
  );
}

export default CompellingReview;
